num_first = float(input("Моля, въведете първото число: "))
num_second = float(input("Моля, въведете второто число: "))

if (num_first == num_second):
    print("Числата са равни.")
else:
    print("Числата са различни.")
    num_max = max(num_first, num_second)

    if (num_max > num_first):
        print("Второто число е по-голямо от първото число." "\n"
              "Съответно първото число е по-малко от второто число.")
    else:
        print("Първото число е по-голямо от второто число." "\n"
              "Съответно второто число е по-малко от първото число.")
